* {
  padding: 0;
  margin: 0;
  z-index: 1;
  font-family: 'Noto Sans KR', sans-serif;
}

li {
  list-style: none;
}

a {
  text-decoration: none;
  color: #000;
}
body {
  position: relative;
  z-index: -1;
}

