/* pop_up */
.pop_up {
  width: 350px;
  height: 550px;
  position: absolute;
  left: 50%;
  top: 400px;
  transform: translate(-50%, -30%);
  z-index: 15;
  background-color: rgba(255,255,255,0.9);
  box-shadow: 5px 5px 5px;
  border-radius: 10px;
}
.pop_up input {display: none;}
.pop_up label {
  display: block;
  width: 10px;
  height: 20px;
  font-size: 18px;
  font-weight: bold;
  float: right;
  padding: 5px 20px 15px;
  cursor: pointer;
  background-color: #eee;
  border-radius: 10px;
}
.pop_up_outer {
  width: 300px;
  height: 500px;
  margin: 25px;
  background-color: #fff;
  border-radius: 10px;
}


.pop_up_box ul li:nth-child(1) {
  width: 100%;
  height: 50px;
  text-align: center;
  line-height: 50px;
  font-size: 17px;
  font-weight: bold;
  color: blue;
}
.pop_up_box ul li:nth-child(2),
.pop_up_box ul li:nth-child(4),
.pop_up_box ul li:nth-child(6),
.pop_up_box ul li:nth-child(8),
.pop_up_box ul li:nth-child(10),
.pop_up_box ul li:nth-child(12),
.pop_up_box ul li:nth-child(14),
.pop_up_box ul li:nth-child(16),
.pop_up_box ul li:nth-child(18) {
  width: 40%;
  float: left;
  text-align: right;
  padding-bottom: 10px;
  margin-right: 5px;
  font-size: 14px;
}
.pop_up_box ul li:nth-child(3),
.pop_up_box ul li:nth-child(5),
.pop_up_box ul li:nth-child(7),
.pop_up_box ul li:nth-child(9),
.pop_up_box ul li:nth-child(11),
.pop_up_box ul li:nth-child(13),
.pop_up_box ul li:nth-child(15),
.pop_up_box ul li:nth-child(17),
.pop_up_box ul li:nth-child(19) {
  width: 56%;
  padding-bottom: 10px;
  float: left;
}
.pop_up_box ul li:nth-child(20) {
  width: 100%;
  height: 10px;
  text-align: center;
  margin-bottom: 10px;
  font-size: 19px;
  float: left;
  line-height: 8px;
}
.pop_up_box ul li:nth-child(21) {
  width: 70%;
  height: 120px;
  float: left;
  margin-left: 45px;
  text-align: center;
  font-weight: bold;
  color: blue;
}
.pop_up_box ul li:nth-child(17) img {
  width: 40px;
  margin: 0 auto;
  margin-top: 15px;
  display: block;
}









