.warp {
  position: relative;

  #QuickMenu {
    z-index: 9999;
    position: fixed;
    right: 10px;
    top: 50%;
    transform: translateY(-50%);
    width: 50px; /* width 50px */
    height: 250px;
    box-sizing: border-box;
    background-color: #fff;
    border-radius: 5px;
    border: 1px solid #eee;
    box-shadow: 3px 3px 5px #000;

    .QuickMenu_box {
      display: flex;
      flex-direction: row;
      flex-wrap: wrap;

      .Q_menu {
        width: 50px;
        height: 50px;
        border-bottom: 1px solid #ccc;
        box-sizing: border-box;
        padding: 5px;

        img {
          width: 100%;
          height: 100%;
          display: block;
        }
      }
      .QuickMenu_My,
      .QuickMenu_DeliveryCheck,
      .QuickMenu_Cart,
      .QuickMenu_ViewProduct {
        width: 150px;
        overflow: hidden;
        padding: 0;
        display: flex;
        cursor: pointer;

        .QuickMy_txt,
        .QuickDeliveryCheck_txt,
        .QuickCart_txt,
        .QuickViewProduct_txt {
          width: 0px;
          font-size: 14px;
          line-height: 50px;
          text-align: center;
          cursor: pointer;
        }
        .QuickMy_img,
        .QuickDeliveryCheck_img,
        .QuickCart_img,
        .QuickViewProduct_img {
          width: 50px;
          padding: 5px;
          box-sizing: border-box;

          img {
            width: 47px;
            height: auto;
            display: block;
            margin-left: -11%;
            margin-top: -5%;
          }
        }
        .QuickDeliveryCheck_img img,
        .QuickCart_img img,
        .QuickViewProduct_img img {
          width: 39px;
          margin: 0;
        }
      }




      .QuickMenu_UP_Down {
        position: absolute;
        bottom: 0;
        width: 50px;
        height: 50px;
        line-height: 25px;
        font-size: 18px;
        border-bottom: none;
        padding: 0;
        text-align: center;
        color: #777;
        overflow: hidden;
        cursor: pointer;
        box-sizing: border-box;
        padding: 3px;

        .QuickUp {
          width: 100%;
          height: 50%;
          border-bottom: 1px solid #ccc;
          box-sizing: border-box;
          overflow: hidden;
        }
        .QuickUp a,
        .QuickDown a {
          color: #777;
          display: block;
        }
      }
    }
  }

    .Q_menu {
      width: 50px;
      height: 50px;
    }
  }

