          box-sizing: border-box;
          float: left;

          img {
            width: 100%;
            height: auto;
            display: block;
          }
        }
        .ft_SNS {
          display: flex;
          justify-content: space-around;
          width: 200px;
          margin-top: 25px;
          font-size: 20px;
          float: right;
        }
        
      }
    }
    .foot_mid {
      width: 65%;
      background-color: #eee;

      .ft_menu {
        height: 22vh;
        font-weight: normal;

        ul {
          width: 24%;
          float: left;

          li {
            padding: 4px 0;
            text-align: center;
            font-size: 12px;

            a {
              color: #777;
              display: block;
            }
          }
          li:hover a {
            color: $PointColor;
            font-weight: bold;
            transition: 0.3s;
          }
          li:first-child {
            padding-bottom: 7px;
            font-size: 14px;
            font-weight: bold;
            
            a {
              color: #444;
            }
          }
        }
        ul:nth-child(1) {
          margin-left: 2%;
        }
        ul:nth-child(4) {
          width: 24%;
        }
      }

      .ft_info1 {
        height: 7vh;

        .info_spanBox1,
        .info_spanBox2 {
          display: flex;
          justify-content: space-around;
          width: 100%;
          height: 25px;
          margin-bottom: 5px;

          span {
            width: 150px;
            height: 40px;
            text-align: center;
            line-height: 40px;

            a {
              color: #444;
            }
          }
        }
        .info_spanBox2 {
          span:nth-child(2) a {
            color: red;
          }
          span:nth-child(4) a {
            color: blue;
          }
          select {
            width: 150px;
            height: 35px;
            outline: none;
            border: none;
            background-color: none;
            font-size: 12px;
            font-weight: bold;
            background-color: #eee;
            text-align: center;
            color: #444
            ;
          }
        }

      }
    }
    .foot_btm {
      width: 35%;
      height: 22vh;
      margin: 0;
      padding: 0;
      padding: 20px;
      box-sizing: border-box;

      .ft_info2 {
        display: flex;
        flex-direction: row;
        flex-wrap: wrap;
        justify-content: space-between;
        height: 15vh;

        span {
          display: inline-block;
          height: 0px;
          text-align: left;
          font-weight: normal;
          letter-spacing: -0.5px;
        }

        span:nth-child(1) {
          padding: 0;
          text-align: left;
        }
        span:nth-child(4) a,
        span:nth-child(8) a {
          font-weight: bold;
          color: $PointColor;
        }
        span:nth-child(7) {
          font-size: 12px;
          font-weight: bold;
          letter-spacing: -0.4px;
          
          a {
            color: $PointColor;
          }
        }
        span:nth-child(9) {
          font-weight: bold;
          color: red;
        }
      }
      .ft_CS_CENTER {
        width: 100%;
        height: 10vh;
        margin-top: 4vh;

        .CS_btn {
          height: 10vh;
          float: left;

          input {
            display: none;
          }

          label {
            display: inline-block;
            width: 150px;
            height: 40px;
            text-align: center;
            line-height: 40px;
            font-size: 14px;
            border-radius: 30px;
            border: 2px solid $PointColor;
            background-color: #fff;
            margin-top: 15px;
            box-shadow: 1.5px 1.5px 3px #000;
            color: #000;
          }
          label:hover {
            background-color: $PointColor;
            color: #fff;
            transition: 0.3s;
          }
        }
        h1 {
          height: 70px;
          line-height: 70px;
          float: left;
          color: #000;
          text-align: right;
          margin: 0 25px;
        }
        h1:nth-child(2) {
          width: 150px;
          height: 50px;
          float: right;
          margin-right: 0px;
          text-align: center;
        }
        h1:nth-child(3) {
          margin-right: 0;
        }
        p {
          width: 150px;
          height: 35px;
          text-align: center;
          float: right;
        }
      }
    }
  }
}
